y information and support in collecting and using related research, \r\n\r\n4. Promote innovation & knowledge transfer in economic, social, cultural and environmental sectors, \r\n\r\n5. Support and participate in provincial and national networks that undertake rural revitalization research.',1,'1','in_class','draft_proposal','2014-05-18','2015-05-18',NULL,NULL,NULL,NULL,NULL);
